import request from '@/utils/request';
export function addRecords(data) {
  return request({
    url: "/iwms/stores/receives",
    method: 'post',
    data: data
  });
}
export function queryRecords(query) {
  return request({
    url: "/iwms/stores/receives/".concat(query.receiveOrderNumber, "/items"),
    method: 'get',
    params: query
  });
}
